textOriginal:
Os imbecis se enganam. Olha a inflação do Brasil, índice de desemprego e a balança comercial. Vamos apostar aqui quantos irão fazer o L se:
1. O Lula fizer pior no primeiro ano;
2. O Lula mexer em qualquer um desses índices para pior;
3. Continuar a escalar, com o STF, a CENSURA;
Sabe, todos temos o direito da dúvida e dou o meu que o Lula tem que fazer melhor. Não igual, nem pior, mas melhor. A única dúvida é: Lula nunca governou com tantas mudanças e desfavorecimentos a ele. O que será que ocorrerá se ele, no primeiro ano, fizer pior do que pegou? Deixarei minha risada para depois, pois cada um que fez o L, vai ter que explicar essa burrice. Eu só assisto a derrocada se ele não fizer o certo. E de certo, ele nunca fez, mas dado o número de imbecis, acho que muitos buscam a governança através de seus pares.
